(5903, 'Formule Salade + Dessert Poulet mariné + Mousse au chocolat', 'Salade d\'aiguillettes de poulet marinées, taboulé, choux blancs, carottes, oignons, raisins, vinaigrette olive balsamique.', '355 g', 'Bonduelle', 'bonduelle', 'Plats préparés,Salades composées', 'Saveurs de l\'Année,Saveurs de l\'Année 2015', 'France', 'Ingrédients salade (78%): Chou blanc (17%), carottes (14%), _blé_ dur précuit concassé (13%), semoule de _blé_ dur réhydratée (13%), aiguillettes de poulet marinées cuites (13%) (aiguillette de poulet, marinade (maltodextrine, sel, dextrose, extrait de levure, poudre de tomate, poudre d\'oignon, arôme, sucre, poudre de citron vert, poudre d\'ail, herbes aromatiques, huile de citron, extrait d\'épice (paprika)), stabilisants (E407a, E451), amidon de pomme de terre, sel, dextrose, sucre roux), poivrons, oignons (6%), maïs, huile de colza, raisin (0,9%) (raisin, huile de colza), huile d\'olive vierge extra, ketchup (0,7%) (purée de tomate, dextrose deblé, sucre, vinaigre d\'alcool, sel, amidon transformé de maïs, arôme naturel), vinaigre d\'alcool, sel, concentré de jus de citron, persil, purée de tomates (0,3%), sucre, arômes naturels, épices, conservateur : E202. Ingrédients vinaigrette olive balsamique (6%) : Huile de colza (59%), vinaigre balsamique (25%)(vinaigre de vin, moût de raisin cuit, colorant : E150d) (_sulfites_), huile d\'olive vierge extra (16%). Ingrédients petit pain grillé au blé complet (3%) : Farine de _blé_ complet (45%), farine de _blé_, huile végétale (colza), sucre, levure, extrait de malt d\'_orge_, sel, _gluten_, agent de traitement de la farine : acide ascorbique. Ingrédients mousse au chocolat (13%) : _Œufs_ frais (43%), chocolat (27%) (pâte de cacao, sucre, cacao maigre en pudre, émulsifiant : lécithine de _soja_), _crème_ fraîche (_lait_), sucre.', '', 'Céleri,Crustacés,Œufs,Poisson,Lait,Moutarde,Fruits à coque,Arachides,Graines de sésame,Soja', '6', 'E150d - Caramel au sulfite d\'ammonium,E202 - Sorbate de potassium,