(5904, 'Formule Salade + Dessert Jambon dés de Gouda + Délice à la framboise', 'Salade de jambon, gouda, pâtes, tartare de tomates, carottes, vinaigrette olive balsamique', '400 g', 'Bonduelle', 'bonduelle', 'Plats préparés,Salades composées', 'Saveurs de l\'Année,Saveurs de l\'Année 2015', 'France', 'Ingrédients salade (67%): Pâtes alimentaires (39%) (semoule de _blé_ dur, _œufs_), tomates (32%), carottes (9%), jambon cuit supérieur (9%) (jambon de porc 92%, eau, sel, dextrose, gélatine de porc, conservateurs : nitrite de sodium - ascorbate de sodium), gouda olive tomate (3%) (_lait_, sel, coagulant, olive, tomate, basilic, ferments lactiques, arôme d\'ail, conservateur : E251, anti-agglomérant : amidon), huile d\'olive vierge extra, huile de colza, tomates déshydratées, persil, sel, enrobage provençal (épice et plantes aromatiques, sel, maltodextrine, tomate et poivrons déshydratés, arômes naturels, sucre, chapelure deblé, huile d\'olive, huile de tournesol, colorant : E160c), concentré de jus de citron, sucre, basilic, ciboulette, arômes naturels, épice, épaississant : gomme xanthane, conservateur : E202. Ingrédients vinaigrette olive balsamique (5%) : Huile de colza (59%), vinaigre balsamique (25%) (vinaigre de vin, moût de raisin cuit, colorant : E150d) (_sulfites_), huile d\'olive vierge extra (16%). Ingrédients petit pain grillé au _blé_ complet (3%) : Farine de _blé_ complet (45%), farine de _blé_, huile végétale (colza), sucre, levure, extrait de malt d\'orge, sel, _gluten_, agent de traitement de la farine : acide ascorbique. Intrédients dessert de framboises et de pommes avec morceaux (25%) : Framboises (44%), pommes (35%), sucre, gélifiant : pectine de fruits, antioxydant : acide ascorbique.', '', 'Céleri,Crustacés,Œufs,Poisson,Lait,Moutarde,Fruits à coque,Arachides,Graines de sésame,Soja', '10', 'E150d - Caramel au sulfite d\'ammonium,E160c - Extrait de paprika,E202 - Sorbate de potassium,E250 - Nitrite de sodium,E251 - Nitrate de sodium,E300 - Acide as